function create() {
	//GAME OPTIONS//
	this.throwCount = 0;
	this.count = 59;
	this.applePoints = 0.00;
	this.moneyPoints = 0.20;
	this.rotationSpeed = 2;
    this.throwSpeed = 150;
    this.minAngle = 15;
    this.rotationVariation = 1;
    this.changeTime = 6000;
    this.maxRotationSpeed = 1;
	this.currentLevel = 0;
	this.flagLevel = 1;
	this.levelKnifes = [6];
	this.levelApples = [5];
	this.adHasEnd = false;
	this.sceneText = ["Hit the wheel with all your knifes,\ndon't forget apples","all right, try to get them all","oh god a big tomato! Fight it!",""];
	this.chances = this.levelKnifes[this.currentLevel];
	///////////
	this.currentRotationSpeed = this.rotationSpeed;
    this.newRotationSpeed = this.rotationSpeed;
	this.canThrow = true;

	this.musicLoop = game.add.audio('bgMusic',0.1,true);
	this.musicLoop.play();
	this.hitTarget = game.add.audio('hitTarget',0.5);
	this.appleHit = game.add.audio('appleHit',0.5);
	this.throwSfx = game.add.audio('throwKnife',0.5);
	this.failSFX = game.add.audio('fail',0.5);
	this.finishLevel = game.add.audio('finishLevel',0.1);
	this.boxExplode = game.add.audio('boxExplode',0.3);

	this.bg = game.add.sprite(this.game.width*0.6, this.game.height*0.5,'bg');
    this.bg.scale.set(1.5);
    this.bg.anchor.set(0.5);

    this.createLevel();
    this.createUI();
    this.createCTA();

}

function createLevel(){
	this.Rotatingknives = this.add.group();
	this.RotatingApples = this.add.group();

	this.player = game.add.sprite(this.game.width*0.5, this.game.height*0.82,'atlas','knife_0.png');
    this.player.anchor.set(0.5);

    this.trunk = game.add.sprite(this.game.width*0.5, this.game.height*0.35,'atlas','target.png');
    this.trunk.scale.set(1.5);
    this.trunk.anchor.set(0.5);

    for (var i = 0; i < 3; i++){
		var appleAngle = (i+1)*40;
	    var radians = Phaser.Math.degToRad(appleAngle - 90);
	    var apple = this.add.sprite(this.trunk.x + (this.trunk.width*0.5) * Math.cos(radians), this.trunk.y + (this.trunk.width*0.5) * Math.sin(radians), 'atlas','coin.png');
	    apple.scale.set(0.8);
	    apple.anchor.set(0.5,1);
	    apple.angle = appleAngle;
	    apple.startAngle = appleAngle;
	    apple.hit = false;
	    this.RotatingApples.add(apple);

	    var knifeAngle = (i+1)*50;
	    var radians2 = Phaser.Math.degToRad(knifeAngle + 90);
        var knife = this.game.add.sprite(this.trunk.x + (this.trunk.width*0.5) * Math.cos(radians2), this.trunk.y + (this.trunk.width*0.5) * Math.sin(radians2), 'atlas','enemy.png');
        knife.anchor.set(0.5);
        knife.impactAngle = knifeAngle;
        knife.angle = knifeAngle;
	    this.Rotatingknives.add(knife);
	}

    this.game.time.events.loop(this.changeTime, changeSpeed, this);
	this.game.input.onDown.add(throwKnife, this);
}

