function changeSpeed(){
    var sign = Phaser.Math.between(0, 1) == 0 ? -1 : 1;
    var variation = Phaser.Math.random(-this.rotationVariation, this.rotationVariation);
    this.newRotationSpeed = (this.currentRotationSpeed + variation) * sign;
    this.newRotationSpeed = Phaser.Math.clamp(this.newRotationSpeed, -this.maxRotationSpeed, this.maxRotationSpeed);
}

function throwKnife(pointer){
	if(pointer.y >= this.game.height*0.9)return;
	if(this.adHasEnd)return;

    if(this.canThrow){
    	if(this.hand.alpha == 1)
    		this.handTween.start();

    	this.throwSfx.play();
    	this.canThrow = false;
    	this.throwTween = this.game.add.tween(this.player).to({y: this.trunk.y + this.trunk.width*0.5}, this.throwSpeed, Phaser.Easing.Linear.None,true);
    	
    	if(this.knifes.children[Math.abs(this.chances-this.levelKnifes[this.currentLevel])]){
	    	var greenKnife = this.knifes.getChildAt(Math.abs(this.chances-this.levelKnifes[this.currentLevel]));
	    	this.chances--;
	    	greenKnife.alpha = 0;
	    }

    	this.throwTween.onComplete.add(function(){
    		var legalHit = true;
            var children = this.Rotatingknives.getAll();

            for (var i = 0; i < children.length; i++){
                // is the knife too close to the i-th knife?
                if(Math.abs(Phaser.Math.getShortestAngle(this.trunk.angle, 180+children[i].impactAngle)) < this.minAngle){
                    legalHit = false;
                    break;
                }
            }

            if(legalHit){
                // is the knife close enough to the apple? And the appls is still to be hit?
                this.RotatingApples.forEach(function(apple){
                	if(Math.abs(Phaser.Math.getShortestAngle(this.trunk.angle, 180 - apple.startAngle)) < this.minAngle && !apple.hit && apple.alpha==1){
	                    apple.hit = true;
	                    apple.frameName = 'half_1.png';
	                    apple.scale.set(0.5);
	                    var slice = this.add.sprite(apple.x, apple.y, 'atlas', 'half_2.png');
	                    slice.moveDown();
	                    slice.angle = apple.angle;
	                    slice.scale.set(0.5);
	                    slice.anchor.set(0.5, 1);

	                    this.throwCount++;
	                    this.applePoints+= this.moneyPoints*this.throwCount;
	                    if(this.throwCount >= 3)this.applePoints = 50;
	                    this.pointText.setText('$'+this.applePoints.toFixed(2));

	                    this.appleHit.play();
	                    this.slicesTween = this.game.add.tween(apple).to({y: this.game.height + apple.height,x:Phaser.Math.between(0, this.game.width*0.5),angle: 45},this.throwSpeed * 6, Phaser.Easing.Linear.None,true);
	                    this.slicesTween2 = this.game.add.tween(slice).to({y: this.game.height + apple.height,x:Phaser.Math.between(this.game.width*0.5, this.game.width),angle: 45},this.throwSpeed * 6, Phaser.Easing.Linear.None,true);
	                    this.slicesTween2.onComplete.add(function(){
	                		this.player.y = this.game.height*0.82;
	                    },this);               
	                }
                },this);
               
               	this.game.add.tween(this.trunk).to({y: this.trunk.y - this.trunk.width*0.015}, 250, Phaser.Easing.Bounce.Out,true).yoyo(true);
                this.hitTarget.play();
                this.game.time.events.add(250,function(){this.canThrow = true;});
                var knife = this.game.add.sprite(this.player.x, this.player.y, 'atlas','knife_0.png');
                knife.anchor.set(0.5);
                knife.impactAngle = this.trunk.angle;
                this.Rotatingknives.add(knife);
                this.player.y = this.game.height*0.82;
            }
            else{
            	this.failSFX.play();
            	this.fallTween = this.game.add.tween(this.player).to({y: this.game.height + this.player.height, rotation: 5}, this.throwSpeed*4, Phaser.Easing.Linear.None,true);
     			this.fallTween.onComplete.add(function(){
     				this.game.time.events.add(250,function(){this.canThrow = true;});
     			    this.player.y = this.game.height*0.82;
     			    this.player.angle = 0;
     			},this);
            }

            if(this.flagLevel >=3 && this.chances <= 0){
            	this.boxExplode.play();
            	this.showCTA();
            }
            else if(this.chances <= 0){
            	this.boxExplode.play();
            	this.iconMoney.alpha = 0;
            	this.pointText.alpha = 0;
            	this.moneyText.alpha = 0;
            	this.Rotatingknives.alpha = 0;
            	this.RotatingApples.alpha = 0;
            	this.trunk.alpha = 0;
            	var slice1 = this.add.sprite(this.trunk.x, this.trunk.y, 'atlas', 'TN_Piece1.png');
            	slice1.scale.set(0.9);
    			slice1.anchor.set(0.5);
                slice1.moveDown();

             	var slice2 = this.add.sprite(this.trunk.x, this.trunk.y, 'atlas', 'TN_Piece2.png');
                slice2.scale.set(0.9);
    			slice2.anchor.set(0.5);
                slice2.moveDown();

                var slice3 = this.add.sprite(this.trunk.x, this.trunk.y, 'atlas', 'TN_Piece3.png');
               	slice3.scale.set(0.9);
    			slice3.anchor.set(0.5);
                slice3.moveDown();

                var slice4 = this.add.sprite(this.trunk.x, this.trunk.y, 'atlas', 'TN_Piece4.png');
                slice4.scale.set(0.9);
    			slice4.anchor.set(0.5);
                slice4.moveDown();

                this.finishLevel.play();
                this.game.add.tween(slice1).to({y: this.game.height + slice1.height,x:Phaser.Math.between(0, this.game.width*0.1),angle: 360},this.throwSpeed * 8, Phaser.Easing.Linear.None,true);
                this.game.add.tween(slice2).to({y: this.game.height + slice2.height,x:Phaser.Math.between(0, this.game.width*0.5),angle: 360},this.throwSpeed * 6, Phaser.Easing.Linear.None,true);
                this.game.add.tween(slice3).to({y: this.game.height + slice3.height,x:Phaser.Math.between(this.game.width*0.5, this.game.width),angle: 360},this.throwSpeed * 6, Phaser.Easing.Linear.None,true);
                this.trunkTween = this.game.add.tween(slice4).to({y: this.game.height + slice4.height,x:Phaser.Math.between(this.game.width*0.5, this.game.width),angle: 360},this.throwSpeed * 6, Phaser.Easing.Linear.None,true);
                this.trunkTween.onComplete.add(function(){
            		this.showCTA();
                },this);        
            }
    	},this);

    }
}

function runTimer(){
	this.count--;

	if(this.count <= 0){
        this.game.time.events.removeAll();
		this.count = 0;
	}
	if(this.count < 10)
		this.CTATimer.setText('0:0'+this.count);
	else
		this.CTATimer.setText('0:'+this.count);
}

function showCTA(){
	this.canThrow = false;
	this.adHasEnd = true;
	this.RotatingApples.alpha = 0;
	this.Rotatingknives.alpha = 0;
	this.game.add.tween(this.trunk).to({alpha:0}, 400, Phaser.Easing.Bounce.InOut,true);
	this.knifes.alpha = 0;
	this.player.alpha = 0;
	this.CTAlogoTween.start();
	this.CTAtext2Tween.start();
	this.CTAtext3Tween.start();
	this.CTATimerTween.start();
	this.CTAbtnTween.start();
	this.game.time.events.loop(1000,runTimer,this);
	this.game.input.onDown.add(onClickDownload,this);
}

function update(){
	if(this.adHasEnd)return;

    this.trunk.angle += this.currentRotationSpeed;

    this.Rotatingknives.forEach(function(knife){
        knife.angle += this.currentRotationSpeed;
        var radians = Phaser.Math.degToRad(knife.angle + 90);
        knife.x = this.trunk.x + (this.trunk.width*0.5) * Math.cos(radians);
        knife.y = this.trunk.y + (this.trunk.width*0.5) * Math.sin(radians);
    },this);

    this.RotatingApples.forEach(function(apple){
     	if(!apple.hit){
	        apple.angle += this.currentRotationSpeed;
	        var radians = Phaser.Math.degToRad(apple.angle - 90);
	        apple.x = this.trunk.x + (this.trunk.width * 0.5) * Math.cos(radians);
	        apple.y = this.trunk.y + (this.trunk.width * 0.5) * Math.sin(radians);
    	}
    },this);
    this.currentRotationSpeed = Phaser.Math.linear(this.currentRotationSpeed, this.newRotationSpeed, this.game.time.elapsed / 1000);
}

